import './Campaigns.css';
import React from "react";

const Students = () => {
  return (
    <div className="students-div">
      <div className="students-div-box">
        <div className="students-div">
          <div className="students-div-header">
            <h2 className="students-title">Campaigns</h2>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Students;
